metadata = load_metadata()


def test_vectors(
    tests_dictonaries,
    tests_dictonaries_names,
    test_transcription_denovo_list,
    test_transcription_denovo_list_names,
    non,
    metadata,
    show_plot=True,
):
    passed = []
    errored = []

    fail = False
    for l, i in enumerate(tests_dictonaries):
        if fail:
            break
        for n, di in enumerate(tqdm(tests_dictonaries[l])):
            try:
                project = vector_create_on_dict(metadata, di, show_plot=show_plot)
                if project == None and tests_dictonaries_names[l][n] not in non:
                    errored.append(tests_dictonaries_names[l][n])
                    print(
                        f"\n\nTest id:{str(tests_dictonaries_names[l][n])} not passed!"
                    )
                    print(
                        "Further testing interrupted!\nCheck if all dependencies was installed properly during first run!\nCheck the internet connection!\nIf all should be ok, contact us!"
                    )
                    fail = True
                    break

                else:
                    passed.append(tests_dictonaries_names[l][n])

            except:
                errored.append(tests_dictonaries_names[l][n])

    for n, di in enumerate(tqdm(test_transcription_denovo_list)):
        try:
            project = create_sequence_from_dict(metadata, di, show_plot=show_plot)
            if project == None and test_transcription_denovo_list_names[n] not in non:
                errored.append(test_transcription_denovo_list_names[n])
                print(f"\n\nTest id:{str(tests_dictonaries_names[l][n])} not passed!")
                print(
                    "Further testing interrupted!\nCheck if all dependencies was installed properly during first run!\nCheck the internet connection!\nIf all should be ok, contact us!"
                )
                fail = True
                break

            else:
                passed.append(test_transcription_denovo_list_names[n])

        except:
            errored.append(test_transcription_denovo_list_names[n])

    if len(errored) == 0:
        print("\n\nAll tests passed successfully!")

    return passed, errored


